import React, { Component } from "react";
import { Breadcrumb, Icon, Row, Col, Layout, Card, Carousel, Input, Button, Divider } from "antd";
import { fetchProfiles } from "../../redux/actions/dashboardAction";
import { connect } from "react-redux";
import SideMenuLeft from "../Common/SideMenuLeft";
// import "../../static/css/style.scss";
class Dashboard extends Component {
  state = {
    items: [
      { qnty: 1, item: "apple", id: 1 },
      { qnty: 1, item: "apple", id: 2 },
      { qnty: 1, item: "apple", id: 3 },
      { qnty: 1, item: "apple", id: 4 }
    ]
  };

  componentDidMount() {
    this.props.fetchProfiles();
  }
  Add = (item, i) => {
    console.log("index is... ", item);
    // const p = item[i];
    // console.log("your item", p);
  };

  render() {
    const { users } = this.props;
    console.log("your users....", users);
    return (
      <Layout>
        <Row>
          <Col span={4} md={4} xs={24} className="sidenav">
            <Row>
              <SideMenuLeft />
            </Row>
          </Col>
          <Col span={12} md={12} xs={24}>
            {/* <Row>{this.props.users && this.displayList(users)}</Row> */}
            {this.state.items.map((i, j) => {
              return (
                <div>
                  <Col>
                    <p>
                      {i.item}
                      <span>
                        <button onClick={() => this.Add(item, i)}>{i.qnty}</button>
                      </span>
                    </p>
                  </Col>
                </div>
              );
            })}
          </Col>
          <Col span={4} md={4} xs={24}>
            Dashboard
          </Col>
        </Row>
      </Layout>
    );
  }
}
const mapStateToProps = state => {
  return {
    users: state.profiles
  };
};
function mapDispatchToProps(dispatch) {
  return {
    fetchProfiles: data => {
      dispatch(fetchProfiles(data));
    }
  };
}
export default connect(mapStateToProps, mapDispatchToProps)(Dashboard);
